import style from './index.module.css'
import type { CSSProperties, ReactNode } from 'react'

export type Props = {
  children: ReactNode
  className?: string
  style?: CSSProperties
  variant?: string
}

export function $Component$({
  children,
  className,
  style: inlineStyle,
  variant = 'default',
}: Props): JSX.Element {
  return (
    <div className={[style.wrapper, style[variant], className].join(' ')} style={inlineStyle}>
      {children}
    </div>
  )
}

